import React, { useState } from "react";
import {
  View,
  Text,
  TouchableOpacity,
  Image,
  TextInput,
  StyleSheet,
} from "react-native";

export default function FilterComponent({
  categoriesData,
  selectedCategories, // Pass the selected categories as a prop
  setSelectedCategories, // Function to update selected categories
  clearFilters,
  applyFilters,
}) {
  const [filterText, setFilterText] = useState("");
  const [lowerPriceLimit, setLowerPriceLimit] = useState(""); // State for lower price limit
  const [upperPriceLimit, setUpperPriceLimit] = useState(""); // State for upper price limit

  const handleCategorySelect = (category) => {
    if (selectedCategories.includes(category)) {
      setSelectedCategories(selectedCategories.filter((item) => item !== category));
    } else {
      setSelectedCategories([...selectedCategories, category]);
    }
  };

  const handleCloseFilter = () => {
    clearFilters();
  };

  const handleReset = () => {
    setSelectedCategories([]);
    setLowerPriceLimit(""); // Reset lower price limit
    setUpperPriceLimit(""); // Reset upper price limit
  };

  const isApplyDisabled = selectedCategories.length === 0;

  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.headerText}>Categories</Text>
        <TouchableOpacity onPress={handleCloseFilter}>
          <Image
            source={require("../../../assets/FilterIcon/Close.png")}
            style={styles.closeIcon}
          />
        </TouchableOpacity>
      </View>

      <TextInput
        placeholder="Filter by category..."
        value={filterText}
        onChangeText={(text) => setFilterText(text)}
        style={styles.input}
      />

      <View style={styles.priceFilter}>
        <TextInput
          placeholder="Lower Price"
          value={lowerPriceLimit}
          onChangeText={(text) => setLowerPriceLimit(text)}
          keyboardType="numeric"
          style={styles.priceInput}
        />
        <Text style={styles.priceSeparator}>-</Text>
        <TextInput
          placeholder="Upper Price"
          value={upperPriceLimit}
          onChangeText={(text) => setUpperPriceLimit(text)}
          keyboardType="numeric"
          style={styles.priceInput}
        />
      </View>

      <View style={styles.categoriesContainer}>
        {/* ...same code for rendering categories... */}
      </View>

      <View style={styles.buttonsContainer}>
        <TouchableOpacity
          onPress={handleReset}
          style={[styles.button, { marginRight: 40 }]}
        >
          <Text style={styles.buttonText}>Reset</Text>
        </TouchableOpacity>
        <TouchableOpacity
          onPress={() => {
            // Filter categories based on selected categories and price range
            const filteredCategories = categoriesData.filter((category) => {
              const categoryPrice = parseFloat(category.Price);
              const lowerLimit = parseFloat(lowerPriceLimit);
              const upperLimit = parseFloat(upperPriceLimit);

              const isCategorySelected = selectedCategories.includes(
                category.Category
              );

              // Check if the category is selected and falls within the price range
              return (
                (isCategorySelected || selectedCategories.length === 0) &&
                (!lowerPriceLimit || categoryPrice >= lowerLimit) &&
                (!upperPriceLimit || categoryPrice <= upperLimit)
              );
            });

            // Pass the filtered categories to the applyFilters function
            applyFilters(filteredCategories);
          }}
          style={[
            styles.button,
            { marginLeft: 40 },
            { backgroundColor: isApplyDisabled ? "gray" : "black" },
          ]}
          disabled={isApplyDisabled}
        >
          <Text style={styles.buttonText}>Apply</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
  },
  header: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
  },
  headerText: {
    fontSize: 25,
    fontWeight: "bold",
  },
  closeIcon: {
    width: 35,
    height: 35,
  },
  input: {
    borderBottomWidth: 1,
    borderColor: "gray",
    marginBottom: 20,
    marginTop: 20,
  },
  priceFilter: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    marginBottom: 20,
  },
  priceInput: {
    flex: 1,
    borderBottomWidth: 1,
    borderColor: "gray",
    paddingVertical: 5,
    paddingHorizontal: 10,
    marginRight: 10,
  },
  priceSeparator: {
    fontSize: 18,
  },
  categoriesContainer: {
    flexDirection: "row",
    flexWrap: "wrap",
    justifyContent: "space-between",
  },
  categoryItem: {
    flexDirection: "row",
    alignItems: "center",
    marginVertical: 5,
    width: "48%",
    borderWidth: 1,
    borderRadius: 5,
    padding: 5,
  },
  categoryIcon: {
    width: 20,
    height: 20,
    borderRadius: 10,
    borderWidth: 2,
    justifyContent: "center",
    alignItems: "center",
  },
  selectedIcon: {
    width: 12,
    height: 12,
    borderRadius: 6,
    backgroundColor: "black",
  },
  categoryText: {
    fontSize: 12,
    marginLeft: 5,
  },
  buttonsContainer: {
    flexDirection: "row",
    justifyContent: "space-between",
    marginTop: 10,
  },
  button: {
    backgroundColor: "black",
    padding: 10,
    alignItems: "center",
    borderRadius: 5,
    flex: 1,
  },
  buttonText: {
    color: "white",
  },
});
